import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Sidebar from './pages/dashboard/sidebar';

export default function App() {
  return (
    <div>
      <Routes>
        <Route path="/sidebar" element={<Sidebar />} />
      </Routes>
    </div>
  );
}
